import React from 'react';
import { Route, Switch } from "react-router";
const MainContent = () => {

    return(
        <div className="col-8">
        <Switch>
            <Route exact path="/">
                вапавп
            </Route>
            <Route path="/about">
                апав
            </Route>
            <Route path="/:user">
                цщкдв
            </Route>
            <Route>
                hello
            </Route>
        </Switch>
        </div>
    );
}

export default MainContent;
